import React from "react";
import "./style.css";

function DiscoverCard() {
  return (
    <div className="doctorImage">
      <img
        src="https://i.pinimg.com/originals/26/4e/30/264e30439c42387c1e3c48d2d038429d.png"
        className="doctorImage"
      ></img>
    </div>
  );
}

export default DiscoverCard;
